;; **
;;; What is the influence of the hyperparameters for @@m@@, @@w@@ and @@y@@ on the final fit? Try to put some priors on those as well.
;; **

;; @@
(defn curve [x w]
  (let [m (ecount w)
        phi_x (map #(pow %1 %2)
                   (into [] (repeat m x))
                   (range 0 m 1))]
    (dot w phi_x)))

(with-primitive-procedures [zero-vector identity-matrix dot ecount curve]
  (defquery fit-curve [xs ys]
    (let [m (sample (poisson 5))
          w (sample (mvn (zero-vector (+ m 1)) (identity-matrix (+ m 1))))]
      (map (fn [x y] 
             (observe (normal (curve x w) 10) y))
           xs
           ys)
      {:m m :w w})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;posterior-inference-exercises/fit-curve</span>","value":"#'posterior-inference-exercises/fit-curve"}
;; <=

;; @@
(def samples (take 1000 (doquery :importance fit-curve [xs ys])))


(def m-map 
  (key 
  	(apply max-key 
      val 
        (empirical-distribution
          (collect-by #(:m (:result %)) samples)))))


(def w-exp
  (empirical-mean 
    (collect-by #(:w (:result %)) (filter #(= (:m (:result %)) m-map) samples))))

(println "M:" m-map)
(println "w:" w-exp)
